import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div``

const Header = styled.div`
  disply: flex;
  justify-content: center;
  align-items: center;
  height: 3.5vw;
  border-bottom: 2px solid black;
`
const CompanyIcon = styled.img``

const HeaderTextBoxes = styled.p`
  margin-left: 5vw;
`
const headerTexts = [
  '1. MAKE IT MOVE IN READY',
  '2. ABOUT YOU',
  '3. PITCH YOUR IDEA',
]

const FirstView = styled.div`
  display: flex;
  height: 100vw;
`
const FirstViewLeft = styled.div``

const FirstViewRight = styled.div``

export const App = () => {
  return (
    <Wrapper>
      <Header>
        {headerTexts.map((item, idx) => {
          return <HeaderTextBoxes id={idx}> {item} </HeaderTextBoxes>
        })}
      </Header>
      <FirstView>
        <FirstViewLeft></FirstViewLeft>
        <FirstViewRight></FirstViewRight>
      </FirstView>
    </Wrapper>
  )
}
